import React from 'react'
import './WinLoss.css'
import { useHistory } from 'react-router-dom';
function Loose() {

  const history = useHistory();

  const handleGoBack = () => {
    history.push('/');
  };

  return (
    <div className='wordleLoose'>
      <h1>You both Lost</h1>
      <button className='go-back-btn' onClick={handleGoBack}>Go back</button>
    </div>
  )
}

export default Loose
